text:
 @lulaodamassa3792  Freguês? Eu acho que tú deve tá emocionado. Vou te relembrar. Na história o Flamengo já ganhou 2 títulos em cima de vocês: Copa Mercosul de 1999 e Super Copa do Brasil em 2021 detalhe importante, na década de 90 o Palmeiras tinha um timaço e perdeu. 
Outro detalhe importante: Palmeiras está desde 2017 sem vencer o Flamengo no Brasileiro. E na libertadores o Fla perdeu na prorrogação, ou seja, saiu invicto da competição sem perder no tempo regulamentar. 
Acho que não tem "freguesia" nenhuma, só o que aconteceu foi um time ganhar um título importante em cima do outro, somente isso. Parabéns pelo tri de vocês, mas se tu quiser argumentar com fatos, vai ver que o Palmeiras ganhou menos finais contra o Flamengo e o Mengão não se abate com isso. Ano que vem será diferente 🙅🏽‍♂️🔴⚫

 @marceloramos7104  Desculpa amigo mas você mandou mal agora
Tem muita gente aqui em São Paulo que é de família nordestina como eu 
E não tenho nenhum problema em ser torcedora do Palmeiras e do Náutico inclusive sou sócia do Náutico
